import {
      BrowserRouter as Router,
      Routes,
      Route
    } from "react-router";



import Home from './components/ListEmployeeComponent';


function App() {
  return (
    <>

      <div className='content-wrapper'>
        <div className='main-content'>
            <Route exact path='/' component={Home} />

        </div>
      </div>
     
    </>
  )
}

export default App
